import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'

function Read() {
    const {id} = useParams();
    useEffect(()=> {
        axios.get('http://localhost:8081/'+id)
    }, [])
  return (
    <div>Read</div>
  )
}

export default Read
